import React from "react";
import Todo from "../models/todo";

type Props = {
  items: Todo[];
};

export const Todos = ({ items }: Props) => {
  return (
    <div>
      <ul>
        {items.map((item) => (
          <li key={item.id}>{item.text}</li>
        ))}
      </ul>
    </div>
  );
};
